  <generar_reporte type="javascript" meta=""><![CDATA[getField('BTN_REVISAR').onclick = function() {
  generar_rips();  
}

function generar_rips(){
  
  var q = getField("DATE_INICIO").value+'*'+getField("DATE_FIN").value;
  var rows;
  //var q = 'hola';
  //alert(q);
   //clearGrid();
    
   if (window.XMLHttpRequest) 
      xmlhttp=new XMLHttpRequest();
   else 
      xmlhttp=new ActiveXObject("Microsoft.XMLHTTP");
 
   xmlhttp.onreadystatechange=function(){
      if(xmlhttp.readyState==4 && xmlhttp.status==200){
         //alert('Archivo ZIP generado');
         var rows = eval('(' + xmlhttp.responseText + ')');
        if(rows.length == 0){
           
           return false;
        }
        
        getField("TXT_MUERTE_1").value = rows[0].muerte1;
        getField("TXT_MUERTE_2").value = rows[0].muerte2;
        getField("TXT_MUERTE_3").value = rows[0].muerte3;
        getField("TXT_MUERTE_4").value = rows[0].muerte4;
        getField("TXT_MUERTE_5").value = rows[0].muerte5;
        getField("TXT_MUERTE_6").value = rows[0].muerte6;
        getField("TXT_MUERTE_7").value = rows[0].muerte7;
        getField("TXT_MUERTE_8").value = rows[0].muerte8;
        getField("TXT_MUERTE_9").value = rows[0].muerte9;
        getField("TXT_MUERTE_10").value = rows[0].muerte10;
        getField("TXT_MUERTE_11").value = rows[0].muerte11;
        getField("TXT_MUERTE_12").value = rows[0].muerte12;
        getField("TXT_MUERTE_13").value = rows[0].muerte13;
        getField("TXT_MUERTE_14").value = rows[0].muerte14;
        getField("TXT_MORBI_1").value = rows[0].morbi1;
        getField("TXT_MORBI_2").value = rows[0].morbi2;
        getField("TXT_MORBI_3").value = rows[0].morbi3;
        getField("TXT_MORBI_4").value = rows[0].morbi4;
        getField("TXT_MORBI_5").value = rows[0].morbi5;
        getField("TXT_MORBI_6").value = rows[0].morbi6;
        getField("TXT_MORBI_7").value = rows[0].morbi7;
        getField("TXT_MORBI_8").value = rows[0].morbi8;
        getField("TXT_MORBI_9").value = rows[0].morbi9;
        getField("TXT_MORBI_10").value = rows[0].morbi10;
        getField("TXT_MORBI_11").value = rows[0].morbi11;
        getField("TXT_MORBI_12").value = rows[0].morbi12;
        getField("TXT_MORBI_13").value = rows[0].morbi13;
        getField("TXT_MORBI_14").value = rows[0].morbi14;
      }
   }
   xmlhttp.open("POST", "/rips_ira.php?q="+q, false);
   xmlhttp.send();
  return false;
}]]></generar_reporte>
