  <generar_reporte type="javascript" meta=""><![CDATA[getField('BTN_REVISAR').onclick = function() {
  generar_rips();  
}

function generar_rips(){
  
  var q = getField("DATE_INICIO").value+'*'+getField("DATE_FIN").value;
  var rows;
  //var q = 'hola';
  //alert(q);
   //clearGrid();
    
   if (window.XMLHttpRequest) 
      xmlhttp=new XMLHttpRequest();
   else 
      xmlhttp=new ActiveXObject("Microsoft.XMLHTTP");
 
   xmlhttp.onreadystatechange=function(){
      if(xmlhttp.readyState==4 && xmlhttp.status==200){
         //alert('Archivo ZIP generado');
         var rows = eval('(' + xmlhttp.responseText + ')');
        if(rows.length == 0){
           
           return false;
        }
        
        getField("TXT_EDA_1").value = rows[0].eda1;
        getField("TXT_EDA_2").value = rows[0].eda2;
        getField("TXT_EDA_3").value = rows[0].eda3;
        getField("TXT_EDA_4").value = rows[0].eda4;
        getField("TXT_EDA_5").value = rows[0].eda5;
        getField("TXT_EDA_6").value = rows[0].eda6;
        getField("TXT_EDA_7").value = rows[0].eda7;
        getField("TXT_EDA_8").value = rows[0].eda8;
        getField("TXT_EDA_9").value = rows[0].eda9;
        getField("TXT_EDA_10").value = rows[0].eda10;
        getField("TXT_EDA_11").value = rows[0].eda11;
        getField("TXT_EDA_12").value = rows[0].eda12;
        getField("TXT_EDA_13").value = rows[0].eda13;
        getField("TXT_EDA_14").value = rows[0].eda14;
        getField("TXT_EDA_15").value = rows[0].eda15;
        getField("TXT_EDA_16").value = rows[0].eda16;
        getField("TXT_EDA_17").value = rows[0].eda17;
        getField("TXT_EDA_18").value = rows[0].eda18;
        getField("TXT_EDA_19").value = rows[0].total;
        getField("TXT_HOMBRES").value = rows[0].hombres;
        getField("TXT_MUJERES").value = rows[0].mujeres;
        
      }
   }
   xmlhttp.open("POST", "/rips_eda.php?q="+q, false);
   xmlhttp.send();
  return false;
}]]></generar_reporte>
